class Solution:
    def solution(self, rows: int, cols: int, x_init: int) -> str:
        MOD = 1000003
        directions = {'north': (1, 0), 'east': (0, 1),'south': (-1, 0), 'west': (0, -1)}

        def dfs(x: int, y: int, visited: set) -> int:
            if not (0 <= x < cols and 0 <= y < rows):
                return 0

            if x == x_init and y == rows - 1:
                return 1

            if (x, y) in visited:
                return 0

            visited.add((x, y))
            next_moves = []

            for dx, dy in directions.values():
                nx, ny = x + dx, y + dy
                if 0 <= nx < cols and 0 <= ny < rows:
                    if C[nx][ny] == '>':
                        next_moves.append(('east', nx, ny))
                    elif C[nx][ny] == '<':
                        next_moves.append(('west', nx, ny))

            return sum(dfs(nx, ny, visited) for nx, ny, _ in next_moves) % MOD

        rows, cols, x_init = map(int, input().split())
        C = [[input() for _ in range(cols)] for _ in range(rows)]

        return str(dfs(x_init, rows - 1, set()))

